function query() {
    $("#list").hiMallDatagrid({
        url: './list',
        nowrap: false,
        rownumbers: true,
        NoDataMsg: '没有找到符合条件的数据',
        border: false,
        fit: true,
        fitColumns: true,
        pagination: true,
        idField: "Id",
        pageSize: 15,
        pageNumber: 1,
        queryParams: {},
        toolbar: /*"#goods-datagrid-toolbar",*/'',
        columns:
        [[
            { field: "Id", hidden: true },
            //{ field: "BrandId", hidden: true },
            { field: "BrandName", title: '名称' },
            //{ field: "BrandDesc", hidden: true },
            {
                field: "BrandLogo", title: 'LOGO', align: 'center',
                formatter: function (value, row, index) {
                    var html = "";
                    html += '<img  id="img' + row.Id + '" style="width="100" height="24" src="' + row.BrandLogo + '?' + Date() + '" />';
                    return html;
                }
            },
            {
                field: "AuditStatus", title: '状态', align: 'center',
                formatter: function (value, row, index) {
                    var html = ["<span class=\"btn-a\">"];
                    if (row.AuditStatus == 0)
                        html.push("审核中");
                    else if (row.AuditStatus == 1)
                        html.push("审核通过");
                    else
                        html.push("审核不通过");
                    html.push("</span>");
                    return html.join("");
                }
            },
            {
                field: "operation", operation: true, title: "操作",
                formatter: function (value, row, index) {
                    var id = row.Id;
                    var html = ["<span class=\"btn-a\">"];
                    html.push("<a href='./Show?id=" + id + "'>查看</a>");
                    html.push("</span>");
                    return html.join("");
                }
            }
        ]]
    });
}

