function AddApply() {
    var ajaxGet = function (url, d, fn) {
        var loading = showLoading();
        $.ajax({
            type: "POST",
            url: url,
            data: d,
            dataType: "json",
            success: function (data) {
                loading.close();
                if (data.success == true) {
                    $.dialog.succeedTips('品牌申请成功,正在等待平台审核!', function () { window.location.reload();});
                } else {
                    $.dialog.errorTips(data.msg)
                }
            }
        });
    };

    var mode = $("input[name='mode']:checked").val();
    if (mode == "1") {
        var ids = [];
        $(".choose-brand .checkbox-inline").each(function () {
            var id = $(this).attr("value");
            var name = $(this).text();
            ids.push(id);
        });
        if (ids.length == 0) {
            $.dialog.errorTips("请选择品牌");
            return false;
        }
        var brandLetter = $('#brandLetter').hishopUpload('getImgSrc').toString(),
        remark = $('#band_remark').val();

        if (!brandLetter) {
            $('#brandLetter').find('input').css({ border: '1px solid #f60' });
        } else {
            $('#brandLetter').find('input').css({ border: '1px solid #ccc' });
        }
        if (brandLetter == "")  return false;
        ajaxGet('Apply', { "BrandMode": mode, "BrandId": ids[0], "BrandAuthPic": brandLetter, "Remark": remark });
    }
    else {
        var pic = $("#brandPic").hishopUpload('getImgSrc').toString(),
        authpic = $("#brandAuthPic").hishopUpload('getImgSrc').toString(),
        name = $('#band_name').val(),
        des = $('#band_des').val();
        var reg = /^[a-zA-Z0-9\u4e00-\u9fa5]+$/;

        if (!des) {
            $('#band_des').css({ border: '1px solid #f60' });
            $('#band_des').focus();
        } else {
            $('#band_des').css({ border: '1px solid #ccc' });
        }
        if (!authpic) {
            $('#brandAuthPic').find('input').css({ border: '1px solid #f60' });
        } else {
            $('#brandAuthPic').find('input').css({ border: '1px solid #ccc' });
        }
        if (!pic) {
            $('#brandPic').find('input').css({ border: '1px solid #f60' });
        } else {
            $('#brandPic').find('input').css({ border: '1px solid #ccc' });
        }
        if (!name || name.length > 30 || reg.test(name) == false) {
            $('#band_name').css({ border: '1px solid #f60' });
            $('#band_name').focus();
        } else {
            $('#band_name').css({ border: '1px solid #ccc' });
        }
        
        if (!name ||name.length > 30 || reg.test(name) == false|| !pic || !des || !authpic) return false;

        $.ajax({
            type: 'post',
            url: './IsExist',
            data: { name: name },
            dataType: "json",
            async: false,
            success: function (data) {
                if (data.success == true) {
                    $.dialog.tips("该品牌已存在，请选择申请已有品牌！");
                    return false;
                }
                else
                {
                    ajaxGet('Apply', { "BrandMode": mode, "BrandName": name, "BrandLogo": pic, "BrandAuthPic": authpic, "BrandDesc": des });
                }
            }
        });
        
    }


}